import "slick-carousel/slick/slick.css"; 
import "slick-carousel/slick/slick-theme.css";

import React, { useState, useEffect, Component } from "react";
import { Link } from "react-router-dom";
import Slider from "react-slick";


//styles

import "../carousel/carousel.css"

//images

import python from "../../images/python.png"
import css from "../../images/css.png"
import django from "../../images/django.png"
import javascript from "../../images/javascript.png"
import react from "../../images/react.png"
import group from "../../images/group.png"







export default class AutoPlay extends Component {
    render() {
        const settings = {
            dots: true,
            infinite: true,
            slidesToShow: 3,
            slidesToScroll: 1,
            autoplay: true,
            autoplaySpeed: 2000,
            // cssEase: "linear",
            centerPadding: "60px",
            className: "center",
            centerMode: true,
            slidesToShow: 3,
            speed: 500,
            responsive: [{
                breakpoint: 768,
                settings: {
                slidesToShow: 1,
                centerMode: true, /* set centerMode to false to show complete slide instead of 3 */
                slidesToScroll: 1
                }
            }
            ]
        }
        return (
        <div className="projects-carousel">   
        <div>
            <h2>My Projects</h2>
            <Slider {...settings}>
                <div>
                <img className="slider" src={python} alt="python proj."/>
                </div>
                <div>
                <a href="https://github.com/SheCodesAus/she-codes-django-news-project-Lauraitnas" target="blank"><img className="slider" src={django} alt="python proj."/></a>
                </div>
                <div>
                <img className="slider" src={react} alt="python proj."/>
                </div>
                <div>
                <img className="slider" src={css} alt="python proj."/>
                </div>
                <div>
                <img className="slider" src={group} alt="python proj."/>
                </div>
                <div>
                <img className="slider" src={javascript} alt="python proj."/>
                </div>
            </Slider>
        </div>
        </div> 
        );
    }
}
